-- ----------------------------
--  Table structure for `attachment`
-- ----------------------------
DROP TABLE IF EXISTS `attachment`;
CREATE TABLE `attachment` (
  `attachment_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '附件ID',
  `module` char(32) NOT NULL DEFAULT '' COMMENT '模块',
  `mark` char(60) NOT NULL DEFAULT '' COMMENT '标记标志',
  `type_id` int(5) unsigned NOT NULL DEFAULT '0' COMMENT '类别ID',
  `name` char(50) NOT NULL DEFAULT '' COMMENT '保存的文件名称',
  `name_original` varchar(255) NOT NULL DEFAULT '' COMMENT '原文件名',
  `path` char(200) NOT NULL DEFAULT '' COMMENT '文件路径',
  `size` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '文件大小',
  `ext` char(10) NOT NULL DEFAULT '' COMMENT '文件后缀',
  `is_image` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否图片1是0否',
  `is_thumb` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否缩略图1是0否',
  `downloads` int(8) unsigned NOT NULL DEFAULT '0' COMMENT '下载次数',
  `time_add` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '添加时间上传时间',
  `ip` char(15) NOT NULL DEFAULT '' COMMENT '上传IP',
  `status` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '状态99正常;',
  `md5` char(32) NOT NULL DEFAULT '' COMMENT 'md5',
  `sha1` char(40) NOT NULL DEFAULT '' COMMENT 'sha1',
  `id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '所属ID',
  `aid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '后台管理员ID',
  `uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '前台用户ID',
  `is_show` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否显示1是0否',
  `http` varchar(100) NOT NULL DEFAULT '' COMMENT '图片http地址',
  PRIMARY KEY (`attachment_id`),
  KEY `md5` (`md5`),
  KEY `module` (`module`),
  KEY `mark` (`mark`),
  KEY `id` (`id`),
  KEY `status` (`status`),
  KEY `aid` (`aid`),
  KEY `uid` (`uid`),
  KEY `is_show` (`is_show`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='附件表';

-- ----------------------------
--  Table structure for `blog`
-- ----------------------------
DROP TABLE IF EXISTS `blog`;
CREATE TABLE `blog` (
  `blog_id` int(11) NOT NULL AUTO_INCREMENT,
  `aid` int(11) NOT NULL DEFAULT '0' COMMENT '管理员AID',
  `is_del` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否删除1是0否',
  `is_open` tinyint(1) NOT NULL DEFAULT '1' COMMENT '启用1是0否',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '状态',
  `time_system` timestamp NULL DEFAULT NULL COMMENT '创建时间,系统时间不可修改',
  `time_update` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `time_add` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '添加时间,可修改',
  `title` varchar(255) NOT NULL DEFAULT '' COMMENT '标题',
  `author` varchar(255) NOT NULL DEFAULT '' COMMENT '作者',
  `url` varchar(255) NOT NULL DEFAULT '' COMMENT '网址',
  `url_source` varchar(255) NOT NULL DEFAULT '' COMMENT '来源地址(转载)',
  `url_rewrite` char(255) NOT NULL DEFAULT '' COMMENT '自定义伪静态Url',
  `description` varchar(255) NOT NULL DEFAULT '' COMMENT '摘要',
  `content` text COMMENT '内容',
  `type_id` int(11) NOT NULL DEFAULT '0' COMMENT '类别ID',
  `cat_id` int(11) NOT NULL DEFAULT '0' COMMENT '分类ID',
  `tag` varchar(255) NOT NULL DEFAULT '' COMMENT '标签',
  `thumb` varchar(255) NOT NULL DEFAULT '' COMMENT '缩略图',
  `is_relevant` tinyint(1) NOT NULL DEFAULT '0' COMMENT '相关文章1是0否',
  `is_jump` tinyint(1) NOT NULL DEFAULT '0' COMMENT '跳转1是0否',
  `is_comment` tinyint(1) NOT NULL DEFAULT '1' COMMENT '允许评论1是0否',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序',
  `remark` varchar(255) NOT NULL DEFAULT '' COMMENT '备注',
  PRIMARY KEY (`blog_id`),
  KEY `is_del` (`is_del`,`is_open`,`status`,`type_id`,`cat_id`,`sort`),
  KEY `url_rewrite` (`url_rewrite`)
) ENGINE=InnoDB AUTO_INCREMENT=56 DEFAULT CHARSET=utf8 COMMENT='博客内容';

