  `seo_keyword` varchar(255) NOT NULL DEFAULT '' COMMENT 'SEO关键词',
  PRIMARY KEY (`statistics_id`),
  KEY `blog_id` (`blog_id`)
) ENGINE=InnoDB AUTO_INCREMENT=56 DEFAULT CHARSET=utf8 COMMENT='博客统计';

